import './list.css';

function List() {
  return (
    <div className="list">
      <div className="head-bar">
        <p>Items</p>
      </div>
      <div className="items-display">
        <table>
          <tr className="top-row"></tr>
          <tr className="body-row"></tr>
        </table>
      </div>
    </div>
  )
}

export default List;
